(355, 1, '2019-07-29 12:16:03', '2019-07-29 12:16:03', '<!-- wp:paragraph -->\n<p>Post Formats </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns has-2-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>We can add different post formats to our posts.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>add_theme_support(<strong>\'post-formats\',array(aside,image,gallery,chat)</strong>);</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> now, in that page where we you want to apply post format use<strong> get_post_format()</strong>; </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p> so by creating different post format template we can apply differ type of specific effects ...we have to only access these templates only in our User inteface area.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>But we have to first build support for specific post format. By creating a tempplate of our format type <strong>ex. aside</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>create a  new template with starter name will be start with that slug which we have declared in our<em> view post page area</em>.  <strong><em>contant-aside.ph</em>p</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>like get_template_part(<strong>\'contant\', get_post_format()</strong>);</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>here <strong>contant</strong> is a slug for template name.after that we can add the specific post format type with emeding a hypen sign.php</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Wordpress Development', '', 'inherit', 'closed', 'closed', '', '352-revision-v1', '', '', '2019-07-29 12:16:03', '2019-07-29 12:16:03', '', 352, 'http://localhost:81/wordpress1/2019/07/29/352-revision-v1/', 0, 'revision', '', 0),
