(378, 1, '2019-07-30 03:17:20', '2019-07-30 03:17:20', '<!-- wp:paragraph -->\n<p><em>WP_Query(); is prebuild method or hook to manipulate the results as we want. Basic fundamental is to make change in core of database by applying custom database queries. this Query object takes some parameters.. WP_Query(\'type=post&amp;posts_per_page=1\'); </em> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns has-2-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>     &lt;?php<br>     $lastBlog = new WP_Query(\'type=post&amp;posts_per_page=1&amp;offset=1\'); </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:code -->\n<pre class=\"wp-block-code\"><code>if( $lastBlog->have_posts() ):\n    while( $lastBlog->have_posts() ): $lastBlog->the_post();  ?>\n\n            &lt;?php get_template_part(\'content\',get_post_format()); ?>\n            &lt;!--above will look for \'content-aside.php\' file  -->\n            &lt;hr>&lt;hr>    \n     &lt;?php endwhile; endif; wp_reset_post(); ?></code></pre>\n<!-- /wp:code --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:paragraph -->\n<p>Suppose if want to display latest post on desired page example: Home then we have to manipulate the database with our custom post retrivel query.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Without affecting the rest of the content of the page. After looping through from specific query it stores the $post GLOBAL to the current post in main query.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>It will be tricky if something goes wrong.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Simply,make page template with the name of applicable Page. wp_reset_post(); is our safe guard by not to effect other post.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Example</strong>- Home Page-  p<strong>age-home.php</strong> </p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'WP_Query()', '', 'publish', 'open', 'open', '', 'wp_query', '', '', '2019-07-30 05:06:27', '2019-07-30 05:06:27', '', 0, 'http://localhost:81/wordpress1/?p=378', 0, 'post', '', 0),
